export default class extends React.Component{
    render(){
        return <div>
                <h1>hola</h1>
                <p>bienvenidos</p>
                
                <img src="/static/logo.png"></img>

                <style jsx>{`
                h1 {color: red};
                p {color: blue};
                img{
                 max-width: 50%;
                 display: bloc;
                 margin: 0 auto;   
                }
                `}
                
                </style>

                <style jsx global>{`
                body {background: white};
                `}</style>
            </div>
    }
}
